import {
  BrowserRouter, 
  Routes,
  Route
  } from 'react-router-dom';
// import './App.css';

import LoginPage from './pages/LoginPage'


function App() {
  return (
    <div className='form'>
      <BrowserRouter>
        <Routes>
          <Route exact path="/" component={LoginPage}/>
          {/* <Route exact path="/dashboard" component={Dashboard}/> */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
